import axios from "axios";

async function getHttp(url){
    await axios.get(url)
        .then((response)=>{
            return 2;
        })
        .catch((e)=>{
            throw e;
        })
}

export default {
    install(app){
        app.config.globalProperties.$httpGet=getHttp;
    }
}
